import React, { useState, useEffect, startTransition } from 'react';
import { StatusBar, Image, ScrollView, View, TextInput, Text, StyleSheet, ActivityIndicator } from 'react-native';
import generation from '../images/vectors/icons/Generation.svg';
import sort from '../images/vectors/icons/Sort.svg';
import filter from '../images/vectors/icons/Filter.svg';

const Navbar = () => {

    return (
    <View style={styles.container}>
        <View>
            <Image style={styles.navGeneration} source={generation} alt="generation" onClick={() => setHomeOptions('generation')} />
            <Image style={styles.navSort} source={sort} alt="sort" onClick={() => setHomeOptions('sort')} />
            <Image style={styles.navFilter} source={filter} alt="filter" onClick={() => setHomeOptions('filter')} />
        </View>
    </View>
    )
}

export default Navbar;

const styles = StyleSheet.create({
    container: {
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'flex-end',
        marginTop: 42.5,
        marginRight: 42.5,
        height: 30,
      },
      
      navGeneration: {
        height: 20,
        width: 20,
        marginRight: 20,
      },
      
      navSort: {
        height: 17,
        width: 20,
        marginRight: 20,
      },
      
      navFilter: {
        height: 18,
        width: 20,
      },
})
